INSERT INTO board (btitle, bcontent, bdate, bview, uno, categoryno) VALUES
('피카츄의 전기 공격', '피카츄의 백만볼트가 전투에서 정말 유용하네요!', '2024-09-05 14:31:00', 14, 4, 1),
('리자몽의 불꽃 공격', '리자몽의 화염 방사는 정말 강력해요. 전투에서 강한 효과를 발휘해요!', '2024-09-06 09:15:00', 10, 2, 1),
('이상해씨의 진화', '이상해씨가 이상해풀로 진화하면서 새로운 기술을 배우는 모습이 멋져요.', '2024-09-06 11:45:00', 75, 3, 1),
('꼬부기의 물 타입 공격', '꼬부기의 물총과 물대포는 물 타입 공격에서 정말 강력합니다.', '2024-09-07 10:30:00', 30, 4, 1),
('버터플의 비행 기술', '버터플이 사용하는 날개치기는 전투에서 유용하네요. 특히 비행 타입 상대로!', '2024-09-07 13:00:00', 44, 1, 1),
('내 피카츄가 최고!', '제 피카츄는 정말 특별해요! 백만볼트, 전격파, 그리고 스피드가 뛰어나서 전투에서 항상 승리해요. 자랑스러워요!', '2024-09-15 15:00:00', 4, 1, 5),
('리자몽의 불꽃이 뜨겁다!', '제 리자몽은 불꽃 기술을 완벽하게 소화합니다. 불꽃 방사와 용의 브레스를 사용하는 모습이 정말 멋지네요. 진정한 전투의 왕입니다!', '2024-09-16 10:30:00', 1, 2, 5),
('이상해씨의 진화가 자랑스러워요!', '이상해씨가 이상해풀로 진화한 모습이 너무 자랑스러워요. 특히 레이저빔 기술로 상대를 물리치는 장면이 최고입니다!', '2024-09-17 12:00:00', 9, 3, 5),
('내 블래키는 정말 강력해요!', '블래키의 어둠의 파동과 자원봉사로 팀을 지키는 모습이 자랑스럽습니다. 전투에서 매우 중요한 역할을 하고 있죠.', '2024-09-18 14:45:00', 63, 4, 5),
('뮤츠의 사이킥은 끝내줍니다!', '뮤츠의 사이킥 공격력은 상상을 초월해요. 심리적인 압박과 함께 강력한 전투력을 자랑합니다. 제 최고의 포켓몬이에요!', '2024-09-19 09:15:00', 104, 1, 5),
('피카츄는 너무 오버레이트', '피카츄는 너무 과대평가된 포켓몬이에요. 실제로 전투에서 별로 강하지도 않으면서 왜 그렇게 인기 있는지 이해할 수 없네요.', '2024-09-23 16:00:00', 14, 2, 1),
('리자몽은 전투에서 쓸모없어요', '리자몽이란 포켓몬은 불꽃 공격 외에는 아무것도 할 수 없어요. 전투에서 자주 패배하는 모습을 보니 진짜 실망스러워요.', '2024-09-24 18:30:00', 74, 3, 1),
('거북왕은 너무 느리다', '거북왕은 전투에서 너무 느려서 거의 아무것도 할 수 없어요. 이런 포켓몬은 정말 필요 없다고 생각해요.', '2024-09-25 11:45:00', 37, 4, 1),
('피카츄와 라이츄, 어느 쪽이 더 강할까?', '피카츄와 라이츄 중 어느 쪽이 더 강한가에 대해 토론해 봅시다. 피카츄는 귀여운 외모로 사랑받지만, 라이츄의 전기 공격이 더 강력하다는 의견도 있네요. 여러분은 어떻게 생각하나요?', '2024-09-26 13:30:00', 96, 1, 3),
('이상해씨 vs 이상해풀, 어떤 진화가 더 좋을까?', '이상해씨가 이상해풀로 진화하는 과정에서 어떤 장점과 단점이 있는지에 대해 논의해 봅시다. 이상해풀의 진화가 어떤 전략적 이점을 제공하는지 알고 싶어요.', '2024-09-27 14:00:00', 88, 2, 3),
('리자몽의 화염 공격과 불꽃 타입 포켓몬', '리자몽의 화염 공격이 다른 불꽃 타입 포켓몬과 비교했을 때 어떤 차이점이 있는지 논의해 봅시다. 불꽃 방사와 용의 브레스 중 어떤 기술이 더 효과적인가요?', '2024-09-28 16:15:00', 302, 3, 3),
('꼬부기의 물 타입 공격의 장점과 단점', '꼬부기의 물 타입 공격이 전투에서 어떤 상황에서 유리한지, 어떤 포켓몬들에게 효과적인지 토론해 봅시다. 물타입 기술의 활용도를 높일 수 있는 방법도 함께 논의해요.', '2024-09-29 10:45:00', 87, 4, 3),
('블래키의 어둠 타입 기술과 다른 타입의 상성', '블래키의 어둠 타입 기술이 다른 타입 포켓몬과의 상성에서 어떤 효과를 가지는지에 대해 이야기해 봅시다. 어둠 타입 기술의 전략적 활용에 대한 의견을 나누어요.', '2024-09-30 12:00:00', 41, 5, 3),
('이브이의 기본 정보와 진화 과정', '이브이는 노멀 타입 포켓몬으로, 다양한 형태로 진화할 수 있습니다. 레벨에 따라 물, 불, 전기 등 여러 타입으로 진화하며, 각각의 형태는 고유의 특성과 기술을 지니고 있습니다.', '2024-10-01 09:00:00', 20, 1, 2),
('메타몽의 특성과 기술', '메타몽은 노멀 타입 포켓몬으로, 다른 포켓몬의 형태를 변형할 수 있는 능력을 가지고 있습니다. 메타몽은 ‘변신’이라는 기술을 사용하여 상대 포켓몬의 기술을 그대로 사용할 수 있습니다.', '2024-10-02 10:15:00', 17, 2, 2),
('잠만보의 역할과 진화', '잠만보는 노멀/수면 타입 포켓몬으로, 레벨 20에서 먹고 자는 능력을 통해 전투에서 강력한 방어력을 자랑합니다. 잠만보는 굉장히 느리지만, 체력과 방어력이 뛰어난 포켓몬입니다.', '2024-10-03 11:30:00', 36, 3, 2),
('깜까의 기본 정보와 기술', '깜까는 불꽃 타입 포켓몬으로, 레벨 16에서 깜지로 진화하고, 레벨 36에서 깜방이로 진화합니다. 깜까는 불꽃과 물리 공격 기술을 주로 사용하며, 전투에서 큰 역할을 합니다.', '2024-10-04 12:45:00', 41, 4, 2),
('어니부기의 특징과 기술', '어니부기는 물/악 타입 포켓몬으로, 다양한 물리 및 물타입 기술을 사용할 수 있습니다. 어니부기는 공격적인 전투 스타일과 함께 강력한 물 타입 기술을 갖추고 있습니다.', '2024-10-05 14:00:00', 20, 5, 2),
('가디의 전투 능력과 특성', '가디는 불꽃 타입 포켓몬으로, 강력한 불꽃 공격과 빠른 속도를 자랑합니다. 레벨 35에서 윈디로 진화하며, 불꽃과 바람 기술을 사용하는 데 뛰어난 능력을 발휘합니다.', '2024-10-06 15:30:00', 71, 1, 2),
('전기 타입 포켓몬의 최적 전투 전략은 무엇인가요?', '전기 타입 포켓몬을 사용할 때 가장 효과적인 전투 전략이 무엇인지 알고 싶습니다. 전기 타입 기술 외에 다른 전략이나 조합이 있다면 알려주세요.', '2024-10-07 11:00:00', 14, 1, 4),
('풀 타입 포켓몬의 최적 진화 시점은 언제인가요?', '풀 타입 포켓몬을 진화시키는 데 가장 좋은 시점이나 레벨이 궁금합니다. 진화 시 배울 수 있는 기술과 전투에서의 이점도 알고 싶습니다.', '2024-10-08 13:30:00', 34, 2, 4),
('불꽃 타입 기술 중 가장 효과적인 것은 무엇인가요?', '불꽃 타입 기술 중 어떤 기술이 가장 효과적인지 궁금합니다. 특정 기술이 다른 기술보다 더 유용한 상황이 있다면 알려주세요.', '2024-10-09 15:00:00', 22, 3, 4),
('물 타입 포켓몬의 주요 약점은 무엇인가요?', '물 타입 포켓몬의 주요 약점과 이를 보완하기 위한 전략이 궁금합니다. 특히 어떤 타입의 포켓몬이 물 타입 포켓몬에 강한지 알고 싶습니다.', '2024-10-10 09:00:00', 20, 1, 4),
('드래곤 타입 포켓몬의 효과적인 육성 방법은?', '드래곤 타입 포켓몬을 효과적으로 육성하기 위한 팁이나 전략이 궁금합니다. 어떤 기술을 우선적으로 배워야 하고, 진화 시점은 어떻게 설정하는 것이 좋을까요?', '2024-10-11 11:30:00', 100, 2, 4),
('악 타입 기술의 전투에서의 장점은 무엇인가요?', '악 타입 기술이 전투에서 어떤 장점을 가지고 있는지 알고 싶습니다. 악 타입 기술의 효과적인 사용법과 어떤 상황에서 특히 유용한지에 대해 논의해 보세요.', '2024-10-12 14:00:00', 5, 3, 4);
INSERT INTO comment (ccontent, cdate, bno, uno) VALUES
('피카츄의 백만볼트는 정말 강력하죠. 하지만 다른 전기 타입 기술도 고려해봐야 할 것 같아요.', '2024-09-05 08:08:08', 1, 3),
('리자몽의 불꽃 방사는 강력하지만, 때로는 타입 상성에 따라 다른 기술을 사용하는 게 좋을 때도 있죠.', '2024-09-06 09:45:00', 2, 4),
('이상해씨가 진화하면 정말 멋지죠! 이상해풀의 기술도 꽤 강력해요.', '2024-09-06 12:00:00', 3, 5),
('꼬부기의 물 타입 공격은 물대포가 특히 강력하다고 생각해요. 전투에서 큰 도움이 되죠.', '2024-09-07 11:00:00', 4, 2),
('버터플의 비행 기술은 정말 유용하지만, 특히 어떤 포켓몬에게 유리한지 더 알고 싶네요.', '2024-09-07 14:00:00', 5, 1),
('피카츄의 스피드는 정말 대단해요. 백만볼트와 전격파로 항상 승리하는 모습을 자랑스럽게 생각합니다!', '2024-09-15 15:30:00', 6, 2),
('리자몽의 불꽃 방사와 용의 브레스는 정말 강력한 조합이죠. 전투에서 중요한 역할을 합니다.', '2024-09-16 11:00:00', 7, 3),
('이상해씨의 진화는 정말 자랑스럽죠. 레이저빔 기술로 상대를 물리치는 것도 훌륭합니다.', '2024-09-17 12:30:00', 8, 4),
('블래키의 어둠의 파동은 전투에서 매우 유용하죠. 팀을 지키는 모습도 멋져요.', '2024-09-18 15:00:00', 9, 5),
('뮤츠의 사이킥 공격은 정말 강력합니다. 심리적인 압박이 전투에서 큰 도움이 되죠.', '2024-09-19 09:30:00', 10, 1),
('피카츄가 과대평가된 것 같아요. 실제 전투에서 강력한 포켓몬이 많잖아요.', '2024-09-23 16:30:00', 11, 2),
('리자몽이 불꽃 공격 외에 쓸모가 없다는 건 아닌 것 같아요. 다른 기술도 활용할 수 있어요.', '2024-09-24 19:00:00', 12, 3),
('거북왕은 느리지만 방어력은 뛰어나죠. 전투에서 그 장점이 클 때도 있어요.', '2024-09-25 12:00:00', 13, 4),
('피카츄와 라이츄, 둘 다 장점이 있지만, 라이츄의 전기 공격이 더 강력할 때도 있죠.', '2024-09-26 14:00:00', 14, 5),
('이상해씨의 진화가 전략적 이점을 제공하는 건 맞아요. 특히 레이저빔이 유용하죠.', '2024-09-27 14:30:00', 15, 1),
('리자몽의 화염 공격과 불꽃 타입 포켓몬의 차이점은 분명히 존재해요. 각 기술의 특징을 잘 활용해야 하죠.', '2024-09-28 17:00:00', 16, 2),
('꼬부기의 물 타입 공격은 물총과 물대포가 특히 강력하죠. 상대에 따라 효과적으로 사용해야 해요.', '2024-09-29 11:00:00', 17, 3),
('블래키의 어둠 타입 기술은 전투에서 매우 유용하죠. 다른 타입과의 상성을 잘 고려해야 해요.', '2024-09-30 12:30:00', 18, 4),
('이브이의 진화 과정은 정말 다양하죠. 각 형태가 가지는 특성과 기술이 흥미로워요.', '2024-10-01 09:30:00', 19, 5),
('메타몽의 변신 기술은 상대의 기술을 그대로 사용할 수 있어 매우 유용하죠. 하지만 전략적으로 사용해야 해요.', '2024-10-02 10:45:00', 20, 1),
('잠만보는 체력과 방어력에서 뛰어나지만 느린 속도는 단점이에요. 전투에서 잘 활용해야 하죠.', '2024-10-03 12:00:00', 21, 2),
('깜까의 진화 과정은 흥미로워요. 불꽃과 물리 공격 기술을 잘 활용하면 전투에서 큰 도움이 되죠.', '2024-10-04 13:00:00', 22, 3),
('어니부기의 물리 및 물타입 기술은 매우 강력하죠. 공격적인 전투 스타일을 잘 활용해야 해요.', '2024-10-05 14:30:00', 23, 4),
('가디의 불꽃 공격과 빠른 속도는 전투에서 큰 장점이죠. 윈디로 진화하면 더욱 강력해져요.', '2024-10-06 16:00:00', 24, 5),
('전기 타입 포켓몬의 전투 전략은 상대의 타입에 따라 다르게 적용해야 해요. 기술 조합이 중요하죠.', '2024-10-07 11:30:00', 25, 1),
('풀 타입 포켓몬의 진화 시점은 전략적으로 고려해야 해요. 레벨에 따라 장점이 달라지죠.', '2024-10-08 14:00:00', 26, 2),
('불꽃 타입 기술 중 어떤 기술이 효과적인지는 상황에 따라 달라져요. 다양한 기술을 고려해보세요.', '2024-10-09 15:30:00', 27, 3),
('물 타입 포켓몬의 약점과 보완 전략은 매우 중요하죠. 타입 상성을 잘 이해해야 해요.', '2024-10-10 09:30:00', 28, 4),
('드래곤 타입 포켓몬을 육성할 때 기술과 진화 시점을 잘 선택해야 해요. 효과적인 육성 방법을 찾아보세요.', '2024-10-11 12:00:00', 29, 5),
('악 타입 기술의 전투 장점은 상황에 따라 달라져요. 효과적인 사용법을 잘 익히는 것이 중요해요.', '2024-10-12 14:30:00', 30, 1);
